import React from 'react';
import { ImageBackground, Button, View, Text, StyleSheet, Image } from 'react-native';

import Images from '../../config/Images';
import base from '../../themes/BasicTheme';
import { globalSty } from '../style/globalStyle';

import '../../config/i18n';
import {useTranslation} from 'react-i18next';

const LocScreen = ( {navigation} ) => {

  const {t} = useTranslation();

    return (
      <View style={globalSty.container}>
      <ImageBackground source={Images.NABBackgroundLogo} resizeMode="cover" style={globalSty.image}>
        <Image style={globalSty.logo}
          source={Images.logo}/>
        <Text style={globalSty.texth2}>{t('LocTran.locQ')}</Text>
            <Button
              title={t('LocTran.lYes')}
              onPress={() => navigation.navigate("LocAuto")} style={base.Button}
            />
            <View style = {globalSty.space}/>
            <Button
              title={t('LocTran.lNo')}
              onPress={() => navigation.navigate("LocMan")} style={base.Button}
            />
        </ImageBackground>
      </View>
    )
};


export default LocScreen;
